# 524. Longest Word in Dictionary through Deleting

# Given a string and a string dictionary, find the longest string in the dictionary that can be formed 
# by deleting some characters of the given string. If there are more than one possible results, 
# return the longest word with the smallest lexicographical order. If there is no possible result, return the empty string.

# Example 1:
# Input:
# s = "abpcplea", d = ["ale","apple","monkey","plea"]

# Output: 
# "apple"

# Example 2:
# Input:
# s = "abpcplea", d = ["a","b","c"]

# Output: 
# "a"

import collections
class LongestWord:

    def doit(self, s, d):
        """
        :type s: str
        :type d: List[str]
        :rtype: str
        """

        def isSequence(s, w):
            i = 0
            for c in w:
                if i < len(s) and c in s[i:]:
                    i += s[i:].index(c) + 1
                    continue
                return False

            return True
                
        res = ''
        for w in d:
            if (-len(w), w) < (-len(res), res):
                if isSequence(s, w):
                   res = w

        return res


    def doitBest(self, s, d):   
        """
        :type s: str
        :type d: List[str]
        :rtype: str
        """
        best = ''
        for w in d:            
            if (-len(w), w) < (-len(best), best):
                it = iter(s)
                if all(c in it for c in w):
                    best = w

        return best


    def doit1(self, s, d):
        """
        :type s: str
        :type d: List[str]
        :rtype: str
        """
        def isSubsequence(x):
            it = iter(s)
            return all(c in it for c in x)
        d.sort(key=lambda x: (-len(x), x))
        return next(itertools.ifilter(isSubsequence, d), '')


